impl Solution {
    pub fn minimum_beautiful_substrings(s: String) -> i32 {
        fn is_power_of_5(x: i64) -> bool {
            x != 0 && x.count_ones() == 1 && x.trailing_zeros() % 2 == 0
        }

        let mut dp = vec![None; s.len() + 1];
        dp[0] = Some(0);

        for i in 1..=s.len() {
            let mut val = 0;
            for j in (0..i).rev() {
                val >>= 1;
                val |= (s.as_bytes()[j] - b'0') as i64 * (1 << (i - j - 1));
                if s.as_bytes()[j] == b'1' && is_power_of_5(val) {
                    if let Some(count) = dp[j] {
                        dp[i] = Some(dp[i].map_or(count + 1, |min_count| min_count.min(count + 1)));
                    }
                }
            }
        }

        dp[s.len()].unwrap_or(-1)
    }
}
